    #           task:
    #             type: string
    #             description: Specifies a task to execute (e.g., `deploy` or `deploy:migrations`).
    #             default: deploy
    #           auto_merge:
    #             type: boolean
    #             description: Attempts to automatically merge the default branch into the requested
    #               ref, if it's behind the default branch.
    #             default: true
    #           required_contexts:
    #             type: array
    #             description: The [status](https://docs.github.com/rest/commits/statuses) contexts
    #               to verify against commit status checks. If you omit this parameter, GitHub
    #               verifies all unique contexts before creating a deployment. To bypass checking
    #               entirely, pass an empty array. Defaults to all unique contexts.
    #             items:
    #               type: string
    #           payload:
    #             oneOf:
